sourcesContent:
import mongoose from 'mongoose';

const UserSchema = new mongoose.Schema({
  username: {
    type: String,
    required: true,
    unique: true
  },
  email: {
    type: String,
    required: true,
    unique: true
  },
  password: {
    type: String,
    required: true
  },
  phonenumber: { type: String,
     required: true,
      unique: true },
      
      status: { type: Boolean, default: true },
});

const User = mongoose.model('User', UserSchema);

export default User;

